// Import Libraries
import React from "react";
import Header from './Header';
import Footer from "./footer";
import List from "./List";
import "./App.css";

// Create Component

function App(){
  return (
    <div className="App">
    <Header/>
    <List/>
    <Footer/>
  </div>
  );
}
// Export Default
export default App;
